import React from 'react';
import { connect } from 'react-redux';
import { fetchStreams } from '../../actions/index';

const streams = fetchStreams();

const StreamList = (streams) => {
  return(
    <div className='stream__list'>
      
    </div>
  )
}

export default connect(null,{
  fetchStreams
})(StreamList);
